// client/src/App.js
import React from "react";
import { BrowserRouter, Routes, Route } from "react-router-dom";

// Import your pages/components
import PointsPage from "./pages/PointsPage"; 
// ðŸ”¥ Later add FeedPage, LoginPage, SignupPage, etc.

function App() {
  return (
    <BrowserRouter>
      <Routes>
        {/* Home route just to check rendering */}
        <Route path="/" element={<h1 style={{ padding: 20 }}>ðŸ”¥ Final10 is Live</h1>} />

        {/* Points system */}
        <Route path="/points" element={<PointsPage />} />

        {/* Placeholder for future feed */}
        <Route path="/feed" element={<h2 style={{ padding: 20 }}>Feed Coming Soon...</h2>} />

        {/* 404 fallback */}
        <Route path="*" element={<h2 style={{ padding: 20 }}>Page Not Found</h2>} />
      </Routes>
    </BrowserRouter>
  );
}

export default App;
